        public static MultiPrecision<N12> Omega(MultiPrecision<N12> lambda) {
            MultiPrecision<N12> omega = lambda * (1 - MultiPrecision<N12>.Log(lambda) / (lambda + 1));

            for (int i = 0; i < 1024; i++) {
                MultiPrecision<N12> f = omega + MultiPrecision<N12>.Log(omega) - lambda;
                MultiPrecision<N12> d = (2 * omega * (omega + 1) * f) / (2 * MultiPrecision<N12>.Square(omega + 1) + f);
                omega -= d;

                if (d.IsZero || omega.Exponent - d.Exponent > 360) {
                    break;
                }
            }

            return omega;
        }

        public static MultiPrecision<N12> Sigma(MultiPrecision<N12> lambda) {
            MultiPrecision<N12> sigma = MultiPrecision<N12>.Exp(-lambda - 1);

            return sigma;
        }

        public static MultiPrecision<N12> Value(MultiPrecision<N12> lambda, bool is_complementary = false) {
            if (is_complementary) {
                MultiPrecision<N12> y = (lambda.Sign == Sign.Plus) ? PositiveValue(lambda) : 1 - NegativeValue(lambda);

                return y;
            }
            else {
                MultiPrecision<N12> y = (lambda.Sign == Sign.Plus) ? 1 - PositiveValue(lambda) : NegativeValue(lambda);

                return y;
            }
        }

        private static MultiPrecision<N12> PositiveValue(MultiPrecision<N12> lambda) {
            if (lambda.Sign == Sign.Minus) {
                throw new ArgumentOutOfRangeException(nameof(lambda));
            }

            if (lambda >= asymptotic_plus_threshold) {
                MultiPrecision<N12> omega = Omega(lambda);
                MultiPrecision<N12> y = ApproxUtil.Poly(1 / omega, asymptotic_plus) / omega;

                return y;
            }
            else {
                MultiPrecision<N12> a = APlus(lambda);
                MultiPrecision<N12> y = a / (lambda + 4);

                return y;
            }
        }

        public static MultiPrecision<N12> APlus(MultiPrecision<N12> lambda) {
            if (lambda.Sign == Sign.Minus) {
                throw new ArgumentOutOfRangeException(nameof(lambda));
            }

            if (lambda >= asymptotic_plus_threshold) {
                MultiPrecision<N12> omega = Omega(lambda);
                MultiPrecision<N12> y = ApproxUtil.Poly(1 / omega, asymptotic_plus) / (omega * omega) * (lambda * lambda + MultiPrecision<N12>.PI * MultiPrecision<N12>.PI);

                return y;
            }

            MultiPrecision<N12> a;
            if (lambda >= 64) {
                a = ApproxUtil.Pade(lambda - 64, pade_plus_64_128);
            }
            else if (lambda >= 32) {
                a = ApproxUtil.Pade(lambda - 32, pade_plus_32_64);
            }
            else if (lambda >= 16) {
                a = ApproxUtil.Pade(lambda - 16, pade_plus_16_32);
            }
            else if (lambda >= 8) {
                a = ApproxUtil.Pade(lambda - 8, pade_plus_8_16);
            }
            else if (lambda >= 6) {
                a = ApproxUtil.Pade(lambda - 6, pade_plus_6_8);
            }
            else if (lambda >= 4) {
                a = ApproxUtil.Pade(lambda - 4, pade_plus_4_6);
            }
            else if (lambda >= 2) {
                a = ApproxUtil.Pade(lambda - 2, pade_plus_2_4);
            }
            else if (lambda >= 1) {
                a = ApproxUtil.Pade(lambda - 1, pade_plus_1_2);
            }
            else {
                a = ApproxUtil.Pade(lambda, pade_plus_0_1);
            }

            return a;
        }

        private static MultiPrecision<N12> NegativeValue(MultiPrecision<N12> lambda) {
            if (lambda.Sign == Sign.Plus) {
                throw new ArgumentOutOfRangeException(nameof(lambda));
            }

            MultiPrecision<N12> sigma = Sigma(lambda);

            MultiPrecision<N12> a = (lambda <= asymptotic_minus_threshold) ? ApproxUtil.Poly(1 / sigma, asymptotic_minus) : AMinus(lambda);

            MultiPrecision<N12> scale = c / (MultiPrecision<N12>.Sqrt(sigma) * MultiPrecision<N12>.Exp(sigma));
            MultiPrecision<N12> y = a * scale;

            return y;
        }

        public static MultiPrecision<N12> AMinus(MultiPrecision<N12> lambda) {
            if (lambda.Sign == Sign.Plus) {
                throw new ArgumentOutOfRangeException(nameof(lambda));
            }

            if (lambda < asymptotic_minus_threshold) {
                return ApproxUtil.Poly(1 / Sigma(lambda), asymptotic_minus);
            }

            MultiPrecision<N12> a;
            if (lambda <= -6) {
                a = ApproxUtil.Pade(-lambda - 6, pade_minus_6_8);
            }
            else if (lambda <= -4) {
                a = ApproxUtil.Pade(-lambda - 4, pade_minus_4_6);
            }
            else if (lambda <= -3) {
                a = ApproxUtil.Pade(-lambda - 3, pade_minus_3_4);
            }
            else if (lambda <= -2) {
                a = ApproxUtil.Pade(3.0 + lambda, pade_minus_2_3);
            }
            else if (lambda <= -1.5) {
                a = ApproxUtil.Pade(2.0 + lambda, pade_minus_1p5_2);
            }
            else if (lambda <= -1) {
                a = ApproxUtil.Pade(1.5 + lambda, pade_minus_1_1p5);
            }
            else if (lambda <= -0.5) {
                a = ApproxUtil.Pade(1.0 + lambda, pade_minus_0p5_1);
            }
            else {
                a = ApproxUtil.Pade(0.5 + lambda, pade_minus_0_0p5);
            }

            return a;
        }
    }
